<!DOCTYPE html>
<html>
<head>
    <style>
        .btn-primary {
            color: #fff;
            background-color: #1b6ec2;
            border-color: #1861ac;
        }
        
        .btn {
            width: 10rem;
            margin: 2rem 10rem;
            display: inline-block;
            font-weight: 400;
            line-height: 1.5;
            text-align: center;
            text-decoration: none;
            vertical-align: middle;
            cursor: pointer;
            -webkit-user-select: none;
            -moz-user-select: none;
            user-select: none;
            border: 1px solid transparent;
            padding: 0.375rem 0.75rem;
            font-size: 1rem;
            border-radius: 0.25rem;
        }
        
        .text-content {
          padding-left: 1rem;
          padding-right: 1rem;
        }
        
        .weblink {
            cursor: pointer;
            -webkit-user-select: none;
            -moz-user-select: none;
            color: #6c757d;
        }
        
        .content {
          width: 34rem;
          margin: 0 auto;
        }
        
        body {
          font-family: 'Helvetica Neue', Helvetica, Arial, sans-serif;
          padding-left: 10rem;
          padding-right: 10rem;
        }

        .logo {
          width: 100%;
          height: auto;
          border-radius: 0.80rem;
        }
        
        footer {
          margin-bottom: 1rem;
          font-size: .875em;
          color: #6c757d;
        }
    </style>
</head>
